import React from 'react';
import styled from 'styled-components';
import {Link} from "react-router-dom"
const tempAvatar = 'https://firebasestorage.googleapis.com/v0/b/novels-a5884.appspot.com/o/temp%2Ftemp.png?alt=media&token=a4d36af6-f5e8-49ad-b9c0-8b5d4d899c0d'

class ProList extends React.Component {
  render() {
    return (
      <div >
        <Probox>
        <Proimg src={tempAvatar}/>  
        <Texttitle>インドアセールスの設計の仕方</Texttitle>
        <Textname>Gifts Japan</Textname>

        </Probox>
      </div>
    );
  }
}

const Proimg = styled.img`
border-radius: 50%; 
width:  150px;       
height: 150px; 
margin: 20px;
position: relative;
`;
const Texttitle = styled.p`
  fontSize: 15px;
  position: relative;
  width: 30%;
  text-align: center;
  margin-top: -30px;
`;
const Textname = styled.p`
  font-size: 35px;
  position: relative;
  width: 30%;
  text-align: center;
  margin-top: -100px;
`;
const Probox = styled.div`
  margin: 10px;
  padding: 5px;
  border: solid #ddd;
  width: 30%;
`;


export default ProList;
